import './App.css';

import Data from './data.json';
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Edit <code>src/App.tsx</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
      <div>
        {Data.map((item) => (
          <div key={item.id}>
            <h3>{item.lastname}</h3>
            <p>{item.city}</p>
          </div>
        ))}
      </div>
    </div>
  );
}
export default App;
